        this.state.network.removeGeneFromNetwork(gene.id);
        var addedGenes = this.state.addedGenes.slice(0);
        var index = addedGenes.indexOf(gene.id);
        if (index > -1) {
            addedGenes.splice(index, 1);
            this.setState({
                addedGenes: addedGenes
            })
        }
